document.getElementById('start-scan').addEventListener('click', function () {
    Quagga.init({
        inputStream: {
            name: "Live",
            type: "LiveStream",
            target: document.querySelector('#barcode-scanner'),
        },
        decoder: {
            readers: ["ean_reader"] // Tipo de códigos de barras que puede leer
        }
    }, function (err) {
        if (err) {
            console.error(err);
            return;
        }
        console.log("Escáner iniciado");
        Quagga.start();
    });

    Quagga.onDetected(function (data) {
        let scannedCode = data.codeResult.code;
        document.getElementById('barcode').value = scannedCode;
        searchArticle(scannedCode);
    });
});

