function searchArticle(barcode) {
    let article = articles.find(item => item.BARRA === barcode);
    if (article) {
        document.getElementById('description').value = article.DESCRIPCION;
    } else {
        document.getElementById('description').value = "Artículo no encontrado";
    }
}

// Exportar a Excel
document.getElementById('export').addEventListener('click', function () {
    let barcode = document.getElementById('barcode').value;
    let description = document.getElementById('description').value;
    let price = document.getElementById('price').value;

    if (barcode && description && price) {
        let data = [
            { BARRA: barcode, DESCRIPCION: description, PRECIO: price }
        ];

        let ws = XLSX.utils.json_to_sheet(data);
        let wb = XLSX.utils.book_new();
        XLSX.utils.book_append_sheet(wb, ws, "Artículos");

        XLSX.writeFile(wb, "articulos_corregidos.xlsx");
        alert("Archivo exportado correctamente.");
    } else {
        alert("Por favor, complete todos los campos antes de exportar.");
    }
});
